import React from "react";
import styled from "styled-components";

const MainBlock = styled.div`
  width: 100vw; // %로 하면 오류가 뜨는데 이유 찾아보기.
  height: 100vh;
  background: #e6e6e6;
`;
const NextBlock = styled.div`
  width: 100vw;
  height: 50vh;
  background: red;
`;

function App() {
  return (
    <>
      <MainBlock />
      <NextBlock />
    </>
  );
}

export default App;
